import React from 'react';
import Icon1 from "./icons/icon1.png";
import Icon2 from "./icons/icon2.png";
import Icon3 from "./icons/icon3.png";


const PRICING = [
    {
        name:"Personal" ,
        features:"custom domains",
        description:"Sleeps after 30 mins of inactivity",
        cost: "Free",
        buttonName: "Sign Up",
        icon:Icon1,
    },
    {

        name:"Small team" ,
        features:"Never sleeps",
        description:"Multiple workers for more powerful apps",
        cost: "Free",
        buttonName: "Sign Up",
        icon:Icon2,
    },
    {
        name:"Enterprise",
        features:"Dedicated",
        description:"Simple horizontal scalability",
        cost: "$400",
        buttonName: "Free trial",
        icon:Icon3,
    },
];

function App() {
    return (
        <div className='py-24  bg-blue-400'>
        <div className='container mx-auto bg-white '>
            <div className="grid grid-cols-3 ">
                {PRICING.map((pricing) => (
                    <div className="border rounded-lg p-5">



                        <h3 className='text-xl font-semibold text-center text-gray- mb-4'>{pricing.name.toUpperCase()}</h3>
                        <p className='text-center  text-blue-600 p-5 uppercase'>{pricing.features}</p>
                        <p className=' text-center  text-blue-600  uppercase '>{pricing.description}</p>
                        <p className='text-3xl font-semibold text-center text-blue-600 py-10'>{pricing.cost.toUpperCase()}</p>
                        <p className='text-xl outline-1 outline-gray-500 text-center  mb-4'>{pricing.buttonName}</p>
                    </div>
                ))}
            </div>
        </div>
        </div>
    );
}

export default App;
